import React from "react";
import "./homeStyles/HomePage.css";
import SelectSearch from "../components/SelectSearch";
import TypeBox from "../components/TypeBox";
import sedan from "../images/sedan-car-13350.svg";

const typebox = [
  { id: 1, text: "Sedan", icon: { sedan } },
  { id: 2, text: "Sedan", icon: { sedan } },
  { id: 3, text: "Sedan", icon: { sedan } },
];

const HomePage = () => {
  return (
    <div>
      <div className="hero-container">
        <div className="home-text">
          <p>Find cars for sale and for rent near you</p>
          <h1>Find Your Dream Car</h1>
          <SelectSearch />
        </div>
      </div>
      <div className="browse-container">
        <h1 className="browse-by-type">Browse by Type</h1>
        <div className="typebox">
          {typebox.map((box) => (
            <TypeBox text={box.text} icon={box.icon} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default HomePage;
